import styled from "styled-components";
import Leftside from "./Leftside";
import Main from "./Main";
import Rightside from "./Rightside";
import Footer from "./Footer";

const Home = (props)=>{
    return(

        <Container>

  <Layout>
 <Leftside></Leftside>
 <Main></Main>
 <Rightside></Rightside>
  </Layout>



  <Footer />



        </Container>

    );
};



const Container = styled.div`
  /* padding-top: 52px; */

  position: absolute;
  left:0;
  top:0;
  padding:0;
  min-width:100%;

`;




const Layout = styled.div`
  display: grid;
  /* background-color:yellow; */

margin-top:0;
  top:0;
  padding:0;

  grid-template-areas: "leftside main rightside";
  /* grid-template-columns: minmax(0, 2.7fr) minmax(0, 12fr) minmax(300px, 7fr); */
  grid-template-columns: minmax(300px, 300px) minmax(0, 15%) minmax(0, 100%);
  column-gap: 25px;
  row-gap: 25px;

  /* margin: 25px 0; */
  @media (max-width: 768px) {
    display: flex;
    flex-direction: column;
    padding: 0 5px;
  }
`;




export default Home;
